import React, { useState } from 'react';

const handleSubmit = (e) => {
    e.preventDefault()
    console.log(formData)
}


export function LogIn() {
    const [formData, setFormData] = useState({
        email: "",
        password: ""   
    });


    return(
        <div style={{paddingLeft: '50px', paddingRight: '100px'}}>
        <h3 > Log In </h3>
        <form onSubmit={handleSubmit}>
            <div className="form-group">
                <label htmlfor="email">Email</label>
                <input type='email' className="form-control" value={formData.email} placeholder="Enter Email"
                onChange={(e)=>{setFormData({...formData, email: e.target.value})}}/>
            </div>
            <div className="form-group">
                <label htmlfor="password">Password</label>
                <input type='password' className="form-control" value={formData.password} placeholder="Password" 
                onChange={(e)=>{setFormData({...formData, password: e.target.value})}}/> 
            </div>
            <button type="submit" className="btn btn-primary" style={{marginTop: '10px', marginLeft: '10px'}}>Submit</button>
            <div style={{paddingBottom: '50px' }}></div>
        </form>
        </div>
    );
}
